100.body:
Rust supports generics, which lets you abstract algorithms or data structures (such as sorting or a binary tree) over the types used or stored. /// Pick `even` or `odd` depending on the value of `n`.
fn pick<T>(n: i32, even: T, odd: T) -> T { if n % 2 == 0 { even } else { odd }
} fn main() { println!("picked a number: {:?}", pick(97, 222, 333)); println!("picked a tuple: {:?}", pick(28, ("dog", 1), ("cat", 2)));
} This slide should take about 5 minutes. Rust infers a type for T based on the types of the arguments and return value. This is similar to C++ templates, but Rust partially compiles the generic function immediately, so that function must be valid for all types matching the constraints. For example, try modifying pick to return even + odd if n == 0. Even if only the pick instantiation with integers is used, Rust still considers it invalid. C++ would let you do this. Generic code is turned into non-generic code based on the call sites. This is a zero-cost abstraction: you get exactly the same result as if you had hand-coded the data structures without the abstraction.

101.body:
You can use generics to abstract over the concrete field type: #[derive(Debug)]
struct Point<T> { x: T, y: T,
} impl<T> Point<T> { fn coords(&self) -> (&T, &T) { (&self.x, &self.y) } fn set_x(&mut self, x: T) { self.x = x; }
} fn main() { let integer = Point { x: 5, y: 10 }; let float = Point { x: 1.0, y: 4.0 }; println!("{integer:?} and {float:?}"); println!("coords: {:?}", integer.coords());
} This slide should take about 10 minutes. Q: Why T is specified twice in impl<T> Point<T> {}? Isn't that redundant? This is because it is a generic implementation section for generic type. They are independently generic. It means these methods are defined for any T. It is possible to write impl Point<u32> { .. }. Point is still generic and you can use Point<f64>, but methods in this block will only be available for Point<u32>. Try declaring a new variable let p = Point { x: 5, y: 10.0 };. Update the code to allow points that have elements of different types, by using two type variables, e.g., T and U.

