Similar to trait bounds, an impl Trait syntax can be used in function arguments and return values: // Syntactic sugar for:
// fn add_42_millions<T: Into<i32>>(x: T) -> i32 {
fn add_42_millions(x: impl Into<i32>) -> i32 { x.into() + 42_000_000
} fn pair_of(x: u32) -> impl std::fmt::Debug { (x + 1, x - 1)
} fn main() { let many = add_42_millions(42_i8); println!("{many}"); let many_more = add_42_millions(10_000_000); println!("{many_more}"); let debuggable = pair_of(27); println!("debuggable: {debuggable:?}");
} This slide should take about 5 minutes. impl Trait allows you to work with types which you cannot name. The meaning of impl Trait is a bit different in the different positions. For a parameter, impl Trait is like an anonymous generic parameter with a trait bound. For a return type, it means that the return type is some concrete type that implements the trait, without naming the type. This can be useful when you don't want to expose the concrete type in a public API. Inference is hard in return position. A function returning impl Foo picks the concrete type it returns, without writing it out in the source. A function returning a generic type like collect<B>() -> B can return any type satisfying B, and the caller may need to choose one, such as with let x: Vec<_> = foo.collect() or with the turbofish, foo.collect::<Vec<_>>(). What is the type of debuggable? Try let debuggable: () = .. to see what the error message shows.

105.body:
In addition to using traits for static dispatch via generics, Rust also supports using them for type-erased, dynamic dispatch via trait objects: struct Dog { name: String, age: i8,
}
struct Cat { lives: i8,
} trait Pet { fn talk(&self) -> String;
} impl Pet for Dog { fn talk(&self) -> String { format!("Woof, my name is {}!", self.name) }
} impl Pet for Cat { fn talk(&self) -> String { String::from("Miau!") }
} // Uses generics and static dispatch.
fn generic(pet: &impl Pet) { println!("Hello, who are you? {}", pet.talk());
} // Uses type-erasure and dynamic dispatch.
fn dynamic(pet: &dyn Pet) { println!("Hello, who are you? {}", pet.talk());
} fn main() { let cat = Cat { lives: 9 }; let dog = Dog { name: String::from("Fido"), age: 5 }; generic(&cat); generic(&dog); dynamic(&cat); dynamic(&dog);
} This slide should take about 5 minutes. Generics, including impl Trait, use monomorphization to create a specialized instance of the function for each different type that the generic is instantiated with. This means that calling a trait method from within a generic function still uses static dispatch, as the compiler has full type information and can resolve which type's trait implementation to use. When using dyn Trait, it instead uses dynamic dispatch through a virtual method table (vtable). This means that there's a single version of fn dynamic that is used regardless of what type of Pet is passed in. When using dyn Trait, the trait object needs to be behind some kind of indirection. In this case it's a reference, though smart pointer types like Box can also be used (this will be demonstrated on day 3). At runtime, a &dyn Pet is represented as a "fat pointer", i.e. a pair of two pointers: One pointer points to the concrete object that implements Pet, and the other points to the vtable for the trait implementation for that type. When calling the talk method on &dyn Pet the compiler looks up the function pointer for talk in the vtable and then invokes the function, passing the pointer to the Dog or Cat into that function. The compiler doesn't need to know the concrete type of the Pet in order to do this. A dyn Trait is considered to be "type-erased", because we no longer have compile-time knowledge of what the concrete type is.

