PartialOrd defines a partial ordering, with a partial_cmp method. It is used to implement the <, <=, >=, and > operators. use std::cmp::Ordering;
#[derive(Eq, PartialEq)]
struct Citation { author: String, year: u32,
}
impl PartialOrd for Citation { fn partial_cmp(&self, other: &Self) -> Option<Ordering> { match self.author.partial_cmp(&other.author) { Some(Ordering::Equal) => self.year.partial_cmp(&other.year), author_ord => author_ord, } }
} Ord is a total ordering, with cmp returning Ordering. This slide should take about 5 minutes. PartialEq can be implemented between different types, but Eq cannot, because it is reflexive: struct Key { id: u32, metadata: Option<String>,
