Types implement From and Into to facilitate type conversions. Unlike as, these traits correspond to lossless, infallible conversions. fn main() { let s = String::from("hello"); let addr = std::net::Ipv4Addr::from([127, 0, 0, 1]); let one = i16::from(true); let bigger = i32::from(123_i16); println!("{s}, {addr}, {one}, {bigger}");
