Default trait produces a default value for a type. #[derive(Debug, Default)]
struct Derived { x: u32, y: String, z: Implemented,
} #[derive(Debug)]
struct Implemented(String); impl Default for Implemented { fn default() -> Self { Self("John Smith".into()) }
} fn main() { let default_struct = Derived::default(); println!("{default_struct:#?}"); let almost_default_struct = Derived { y: "Y is set!".into(), ..Derived::default() }; println!("{almost_default_struct:#?}"); let nothing: Option<Derived> = None; println!("{:#?}", nothing.unwrap_or_default());
