In this example, you will implement the classic "ROT13" cipher . Copy this code to the playground, and implement the missing bits. Only rotate ASCII alphabetic characters, to ensure the result is still valid UTF-8. use std::io::Read; struct RotDecoder<R: Read> { input: R, rot: u8,
