An assignment will transfer ownership between variables: fn main() { let s1: String = String::from("Hello!"); let s2: String = s1; println!("s2: {s2}"); // println!("s1: {s1}");
} The assignment of s1 to s2 transfers ownership. When s1 goes out of scope, nothing happens: it does not own anything. When s2 goes out of scope, the string data is freed. Before move to s2: StackHeaps1ptrHello!len6capacity6 After move to s2: StackHeaps1ptrHello!len6capacity6s2ptrlen6capacity6(inaccessible) When you pass a value to a function, the value is assigned to the function parameter. This transfers ownership: fn say_hello(name: String) { println!("Hello {name}")
} fn main() { let name = String::from("Alice"); say_hello(name); // say_hello(name);
} This slide should take about 5 minutes. Mention that this is the opposite of the defaults in C++, which copies by value unless you use std::move (and the move constructor is defined!). It is only the ownership that moves. Whether any machine code is generated to manipulate the data itself is a matter of optimization, and such copies are aggressively optimized away. Simple values (such as integers) can be marked Copy (see later slides). In Rust, clones are explicit (by using clone). In the say_hello example: With the first call to say_hello, main gives up ownership of name. Afterwards, name cannot be used anymore within main. The heap memory allocated for name will be freed at the end of the say_hello function. main can retain ownership if it passes name as a reference (&name) and if say_hello accepts a reference as a parameter. Alternatively, main can pass a clone of name in the first call (name.clone()). Rust makes it harder than C++ to inadvertently create copies by making move semantics the default, and by forcing programmers to make clones explicit.

