} Notice that the client does not depend on libbirthdayservice. Build, push, and run the client on your device: m birthday_client
adb push "$ANDROID_PRODUCT_OUT/system/bin/birthday_client" /data/local/tmp
adb shell /data/local/tmp/birthday_client Charlie 60 Happy Birthday Charlie, congratulations with the 60 years! Strong<dyn IBirthdayService> is the trait object representing the service that the client has connected to. Strong is a custom smart pointer type for Binder. It handles both an in-process ref count for the service trait object, and the global Binder ref count that tracks how many processes have a reference to the object. Note that the trait object that the client uses to talk to the service uses the exact same trait that the server implements. For a given Binder interface, there is a single Rust trait generated that both client and server use. Use the same service identifier used when registering the service. This should ideally be defined in a common crate that both the client and server can depend on.

